const Awards = (props) => {
    //Award generation
    var awardArray = props.awards.split(',');
    var col1 = [];
    var col2 = [];
    for (var i=0; i<awardArray.length; i++){
        var pointsArray = awardArray[i].split('-');
        if(i%2===1){
            col2.push(<p><b style={{color:'black'}}>{pointsArray[0]}</b></p>);
        }
        else{
            col1.push(<p><b style={{color:'black'}}>{pointsArray[0]}</b></p>);
        }
        for (var j=0; j<pointsArray.length; j++){
            if (j!=0){
                if(i%2===1){
                    col2.push(<p>{pointsArray[j]} </p>);
                    col2.push(<div style={{height:'0px',width:'100%'}}></div>);
                }
                else{
                    col1.push(<p>{pointsArray[j]} </p>);
                    col1.push(<div style={{height:'0px',width:'100%'}}></div>);
                }
            }
        }
    }

    return (
    <div className="row bound my-row">
        <div className="col my-col" style={{width:'100%'}}>{col1}</div>
        <div className="col my-col" style={{width:'50%'}}>{col2}</div>
    </div>
    )
}

export default Awards
